import Avatar from "@mui/material/Avatar";
import Img from "../../assets/images/NCT_제노.PNG";

const ChartBoy = () => {
  const rankBoy = ["NCT 제노", "NCT 제노", "NCT 제노"];

  return (
    <div>
      <h2>남자아이돌 차트</h2>
      <div id="chart-container">
        <div id="rank-1-idol">
          <p>1. </p>
          <Avatar src={Img} sx={{ width: "4rem", height: "4rem" }} />
          <p>NCT 제노</p>
        </div>
        <div id="rank-23-idol">
          <div>
            <p>2. </p>
            <Avatar src={Img} />
            <p>NCT 제노</p>
          </div>
          <div>
            <p>3. </p>
            <Avatar src={Img} />
            <p>NCT 제노</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ChartBoy;
